import React,{Component } from 'react';

class Footer extends Component {

    render() {
        return (
            <footer className="pt-3 pb-3 mt-auto bg-light">
                <div className="bd-footer text-muted">
                    <div className="container">
                        <p>Footer</p>
                    </div>
                </div>
            </footer>
        )
    }
};

export default Footer;
